import { GithubIcon } from "../../icons/Github";
import { LinkedIn } from "../../icons/LinkedIn";
import {
    PageContainer,
    LinkContainer,
    GreetingContent,
    TextContent,
    AboutMeHeader,
    AboutMeContent,
} from "./styles";

const About = () => {
    return (
        <PageContainer>
            <GreetingContent>Hi, I'm Steven Liu</GreetingContent>
            <TextContent>
                I've always loved solving problems and being a technophile who
                was obsessed with the latest tech.
            </TextContent>
            <LinkContainer>
                <GithubIcon />
                <LinkedIn />
            </LinkContainer>
            <AboutMeHeader>About me</AboutMeHeader>
            <AboutMeContent>
                I have studied Computer Science at the University of New south
                wales and I live in Sydney, Australia. I usually code in Python
                but I'm also interested in Typescript, Rust and Serverless.
                Fascinated by making automation and creating human friendly
                tools.
            </AboutMeContent>
            <AboutMeContent>
                While technology and tinkering are passions of mine and working
                in this area brings me joy & pride, I also enjoy playing
                basketball, traveling, and cooking. Chinese cuisine is my
                favorite.
            </AboutMeContent>
            <AboutMeContent>
                Feel free to reach me on{" "}
                <a href="mailto:wzus579@gmail.com">Email</a>!{" "}
            </AboutMeContent>
        </PageContainer>
    );
};

export default About;
